user/templating/Overview.html.body:
Templating
All the templates for patterns are written with the nunjucks template engine (similar to Jinja and Twig). The main benefit of nunjucks is that it is easily customizable via filters and custom tags. The base system has a couple of filters that will help you build cms independant patterns while allowing you to transform or export your patterns to different target systems.
Patterns
Patterns are created by providing a nunjucks macro that will render the pattern as html. Using macros allows you to provide parameters to your patterns.
Example:
{##
    @param {String} [text] - The headline text
    @param {String} [classes] - Any additional classes that will be added to the root element
#}
{% macro a_text(text, classes='') %}

        {{ text }}

{% endmacro %}

Usage:
{{ a_text('Hi') }}

It even allows you to create patterns that "wrap" other patterns. 
Example:
{##
    @param {String} [classes] - Any additional classes that will be added to the root element
#}
{% macro a_link(classes='') %}

        {{ caller }}

{% endmacro %}

Usage:
{% call a_link() %}
    {{ a_text('Hi') }}
{% endcall %}

As you may have noticed the macro parameters are documented with jsdoc. This allows entoj to parse the macros and provide the gathered meta data to interested plugins like exporters and the gui. 
Pages
Pages are used to create mockup pages consisting of your patterns. A page needs a layout to work.
Example:
{% extends '/base/templates/t-default' %}
{% block content %}
    {% call a_link() %}
        {{ a_text('Hi') }}
    {% endcall %}
{% endblock %}

